import '../styles.css';
import { BrowserRouter as Link } from 'react-router-dom';
function Header(){

    function handleToggle(){
        document.querySelector(".navbar-nav").classList.toggle('active')
    }
    

    return(
        <header className="App-header">
            <nav className="navbar">
                <h1>Suresh Stationerys (Adyar)</h1>
                <button class="navbar-toggler" onClick={handleToggle}>&#9776;</button>
                <ul className="navbar-nav">
                    <li className="nav-item"><Link to="/">Home</Link></li>
                    <li className="nav-item"><Link to="/Insert">About</Link></li>
                    <li className="nav-item"><Link to="">Contact</Link></li>
                    <li className="nav-item"><Link to="">Cart</Link></li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
